import React from 'react';

const Current = (props) => {

    return (
        <div>
            <h1>Current Weather for: ${props.city}</h1>

            <p>Temperature: ${props.temp}</p>
            <p><img src={props.icon} alt="weather_icon" /></p>
            <p>UV Index: ${props.uv}</p>
            <p>Humidity: ${props.humidity}</p>
            <p>Precipitation: ${props.precip}</p>

        </div>

    );

    };

export default Current;
